import React from 'react'
import axios from 'axios'

export default class NickDataPage extends React.Component {
    constructor(props) {
        super(props)
        this.getData = this.getData.bind(this)
    }

    componentDidMount() {
        this.getData()
    }

    async getData() {
        const res = await axios.get('https://api.coingecko.com/api/v3/coins/ethereum/contract/0xa7DE087329BFcda5639247F96140f9DAbe3DeED1/market_chart/?vs_currency=usd&days=1')
        const actual = res.data
        console.log(actua)
    }



    render() {
        return (
            <div>Nick data page</div>
        )
    }
}
